// src/components/admin/AdminOCRUpload.jsx
import React from "react";
import AdminDashboard from "./AdminDashboard";
import OCRUpload from "../OCRUpload";

export default function AdminOCRUpload({ auth, setAuth }) {
  if (!auth || auth.role !== "admin") {
    return <p>⚠️ Access denied. Admins only.</p>;
  }

  // We can reuse the AdminDashboard layout with a custom "content" for OCR
  return <AdminDashboard auth={auth} setAuth={setAuth} customContent={<OCRUpload auth={auth} setAuth={setAuth} />} />;
}
